import React from 'react'

export default function ItemList({ items }) {
  const catalog = require("./catalog.json")
  console.log(catalog["abc"])
  return (
    items.map(item => {
      return <tr><td>{catalog[item].itemType}</td><td>{catalog[item].color}</td></tr>
    })
  )
}
